import React, {Component} from 'react';
import './SearchMovie.css'

class MovieCard extends Component{
    render(){
        return(
            <div className="movie-card">
                <img src={this.props.movie.Poster} alt={this.props.movie.Title}></img>
            </div>
        );
    }
}

export default MovieCard;
